    "import os\n",
    "\n",
    "def process_xyz_files(input_dir, output_dir):\n",
    "    # 获取输入目录下的所有.xyz文件\n",
    "    file_list = [file_name for file_name in os.listdir(input_dir) if file_name.endswith(\".xyz\")]\n",
